import React from 'react'
import { Text, View } from 'react-native'

const Federeacion = () => {
    console.log('Está mostrando la vista de Federac')
    return (
        <View>
            <Text>
                vista del Federeacion
            </Text>
        </View>
    )
}

export default Federeacion
